= Qu'est ce qu'un Bookmarklet =

Un Bookmarklet est un lien favoris interactif. Celui de Plante Sankor permet d'ajouter une rfrence URL (adresse internet)  la base de connaissance de la communaut tout en qualifiant le lien d'un titre, d'un commentaire, d'une valuation et mme de mots cls.

[[image:bookmarkletex.png]]

= Comment installer le Bookmarklet =

Afin d'utiliser le bookmarklet  il y'a une opration trs simple  faire en premier lieu, s[[inscrire sur le site>>Main.JoinSankore||rel="__blank"]].

Ensuite, glissez l'image suivante dans votre barre de favoris OU effectuez un clic droit sur ce lien {{html}}<a href="javascript:(function(){document.body.appendChild(document.createElement('script')).src='http://sankore.devxwiki.com/xwiki/bin/jsx/Main/AddResources?minify=true';})();" alt="Bookmarklet Sankor">Bookmarklet Sankor</a>{{/html}} et ajoutez le  vos favoris.

