= Comment utiliser le Bookmarklet =

Ds que vous trouvez une ressource intressante sur internet lie  l'initiative Sankor, cliquez sur le lien "Bookmarklet Sankor" dans vos favoris. Une interface va alors vous guider pas  pas dans l'ajout du lien  la base de partage Sankor.

